import React from 'react';
import { Alert, Button,  StyleSheet, View } from 'react-native';


class App extends React.Component{

  constructor(){
    super();
    this.state={
        data :"Some App Data"
    }
  }

  render() {
      return(
<View >

  <Text  >
    Hello State
    {this.state.data}
    </Text> 

</View>

      );
  }


}

export default App;
